import AdventureCompCard from "./AdventureCompCard";

import { Row } from "react-bootstrap";
import "./AdventureComp.css";

function AdventureComp() {
  return (
    <Row className="style" xs={1} md={3}>
      <AdventureCompCard />
      <AdventureCompCard />
      <AdventureCompCard />
    </Row>
  );
}

export default AdventureComp;
